import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppComponent } from './app.component';
import { IndexComponent } from './index/index.component';
import { VilagkereskedelemComponent } from './vilagkereskedelem/vilagkereskedelem.component';
import { EuropaComponent } from './europa/europa.component';
import { ReszletesAdatokComponent } from './reszletes-adatok/reszletes-adatok.component';

@NgModule({
  declarations: [
    AppComponent,
    IndexComponent,
    VilagkereskedelemComponent,
    EuropaComponent,
    ReszletesAdatokComponent
  ],
  imports: [
    BrowserModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
